import React from "react"
import {
    Link
  } from "react-router-dom";
function Header(){
    return(
        <header class='navbar'>
            <ul>
            <li>
                <Link to="/">Home</Link>
            </li>
            <li>
                <Link to="/about">About</Link>
            </li>
            <li>
                <Link to="/systeminfo">System Info</Link>
            </li>
            </ul>
        </header>
    )
}

export default Header
